import React from 'react';
import '../styles/Resume.css';

const Resume: React.FC = () => {
  return (
      <section id="resume" className="resume-section">
          <h2>My Resume</h2>
          <p className="intro">Below is an overview of my professional experience, education, and skills. You can also
              view my complete resume in PDF format below.</p>
          <div className="pdf-container">
              <iframe src="/James Zheng Resume (4).pdf" width="100%" height="600px">
                  This browser does not support PDF viewing. Please download the PDF to view it: <a
                  href="/James Zheng Resume (4).pdf" download>Download Resume</a>.
              </iframe>
          </div>
          
          <div className="download-section">
              <a href="/James Zheng Resume (4).pdf" download className="btn-download">Download My Resume (PDF)</a>
          </div>
      </section>
  );
}

export default Resume;
